import os
import sqlite3
import time
import sys
import base64

# ======================================================
# БАЗОВЫЕ ПУТИ
# ======================================================

DB_DIR = os.path.dirname(os.path.abspath(sys.argv[0]))


def db_path(name: str) -> str:
    return os.path.join(DB_DIR, name)


def connect(db_name: str):
    return sqlite3.connect(db_path(db_name))


# ======================================================
# ИНИЦИАЛИЗАЦИЯ БАЗ
# ======================================================

def first_msg():
    with connect("Database.db") as db:
        db.execute("""
            CREATE TABLE IF NOT EXISTS First (
                main TEXT
            )
        """)
    return 0


def main_good():
    with connect("Database.db") as db:
        db.execute("""
            CREATE TABLE IF NOT EXISTS Goods (
                number INTEGER,
                name TEXT,
                more TEXT,
                price INTEGER
            )
        """)
    return 0


def main_other():
    with connect("Database.db") as db:
        db.execute("""
            CREATE TABLE IF NOT EXISTS Other_data (
                name_of_shop TEXT,
                time_checkout INTEGER,
                text_about_us TEXT,
                how_bot_works TEXT,
                hours TEXT,
                contact_support TEXT,
                code_death TEXT
            )
        """)
    return 0


def main_result():
    with connect("Database.db") as db:
        db.execute("""
            CREATE TABLE IF NOT EXISTS Resultgoods (
                number INTEGER,
                name TEXT,
                link TEXT
            )
        """)
    return 0


def reviews_db():
    with connect("Database.db") as db:
        db.execute("""
            CREATE TABLE IF NOT EXISTS Reviews (
                reviews TEXT,
                account_link TEXT,
                contact_support TEXT,
                redirect_url TEXT
            )
        """)
    return 0


def API_token():
    with connect("Database.db") as db:
        db.execute("""
            CREATE TABLE IF NOT EXISTS TOKEN (
                token TEXT
            )
        """)
    return 0


def PAY_credentials():
    with connect("Database.db") as db:
        db.execute("""
            CREATE TABLE IF NOT EXISTS Payment (
                Name_kassa TEXT,
                Private_key TEXT,
                Salty_key TEXT
            )
        """)
    return 0


def link_photo_db_changeable():
    with connect("Database.db") as db:
        db.execute("""
            CREATE TABLE IF NOT EXISTS Link_change (
                link TEXT
            )
        """)
    return 0


# ======================================================
# КАРТИНКА ПО УМОЛЧАНИЮ
# ======================================================

def create_photo():
    try:
        data = ''''''
        logo_bytes = base64.b64decode(data)
        with open("logo.jpg", "wb") as img:
            img.write(logo_bytes)
        return 0
    except Exception as e:
        print(f"Ошибка генерации картинки: {e}")


# ======================================================
# ОБЩАЯ ИНИЦИАЛИЗАЦИЯ
# ======================================================

def initialize():
    steps = [
        ("Результатов товаров", main_result),
        ("Первого сообщения", first_msg),
        ("Прочих настроек", main_other),
        ("Карточек товаров", main_good),
        ("Изображения по умолчанию", create_photo),
        ("Отзывов и поддержки", reviews_db),
        ("API токена", API_token),
        ("Платёжных данных", PAY_credentials),
        ("Изменяемой картинки", link_photo_db_changeable),
    ]

    for name, func in steps:
        status = func()
        print(f"Инициализация базы данных {name}. Status: {status}")
        time.sleep(0.15)

    while input("Для продолжения введите 1: ") != "1":
        print("Программа Вас не поняла.")

    os.system("cls" if os.name == "nt" else "clear")
    time.sleep(1)


def reload():
    print("Для сохранения новой информации программа будет перезапущена.")
    time.sleep(5)
    exit()